import "./App.css";
import React, { lazy, Suspense } from "react";

const Checking = React.lazy(() => import("./Check"));

const App = () => {
  return (
    <Suspense fallback={<h1>lol</h1>}>
      <h1>hello</h1>
      <Checking />
    </Suspense>
  );
};

export default App;
